import React from 'react';
import './App.css';
import Form from './components/Form';
import Card from './components/Card';
import loginPage from './components/page/loginPage';

function App() {
  return (
    <div className="App">
        <h1 id='title'>Simple ToDo list app</h1>
        <Form/>
        <Card/>
        <loginPage/>
    </div>
  );
}

export default App;
